import React, {PureComponent} from 'react';
import frameStyle from './index.module.css';
import Logo from "../../components/Logo";
import Banner from "../../components/Banner";
import LoginPanel from "../../components/LoginPanel";
import Tipper from "../../components/Tipper";
import terminal from '../../images/terminal.png';
import cost from '../../images/cost.png';
import online from '../../images/online.png';
import flow from '../../images/flow.png';
import {THEME_COLOR,SECUNDA_COLOR} from "../../constant";

class IndexFrame extends PureComponent {
    render() {
        return (
            <div className={frameStyle.frame}>
                <Logo/>
                <div className={frameStyle.panel}>
                    <Banner/>
                    <LoginPanel/>
                </div>
                <div className={frameStyle.lightSopt}>
                    <Tipper className={frameStyle.item} background={SECUNDA_COLOR} content='飞云办公集成了日常OA、商务邮箱、快文系统、财务报销、即时通讯、流程管理等办公应用于一体，打造全新一站式办公体验，
                    只需要一次登录，即可使用全部服务，免去账号管理与重复登录的烦恼！'
                            title='一站办公' icon={flow}/>
                    <Tipper className={frameStyle.item} background={THEME_COLOR} content='支持windows、IOS、Andriod等多平台，所有数据上云，并自动同步，随时随地自由办公。'
                            title='云边协同' icon={terminal}/>
                    <Tipper className={frameStyle.item} background={SECUNDA_COLOR} content='飞云办公已成为上千家企业首选的解决方案，基于开放的理念，在确保数据独立与安全的前提下，打破传统模式中各个企业的信息鸿沟，允许跨企业OA流转，
                    强化企业之间的协同作战。'
                            title='千企互联' icon={online}/>
                    <Tipper className={frameStyle.item} background={THEME_COLOR} content='飞云办公采用模块化设计，易于解耦，各个功能模块之间即可相互独立，又可无缝对接，即插即用，企业可根据自身业务需求灵活订购业务功能。
                    与此同时，云架构帮助企业释放运维资源，允许企业聚焦生产经营。'
                            title='极致性价' icon={cost}/>
                    <Tipper className={frameStyle.item} background={SECUNDA_COLOR} content='飞云办公系统，集成了日常OA、商务邮箱、快文系统、财务报销、即时通讯、流程管理等办公应用于一体，打造全新一站式办公体验，提高信息流转效率！'
                            title='优势一'/>
                </div>
            </div>
        );
    }
}

export default IndexFrame;
